import axios from 'axios';

const REPORT_API_BASE_URL = "http://localhost:8080/report";

class ReportService{

    getReports(){
        return axios.get(REPORT_API_BASE_URL+ '/' + 'viewall');
    }

    createReport(report){
        return axios.post(REPORT_API_BASE_URL, report);

    }

    updateReport(report){
        return axios.put(REPORT_API_BASE_URL, report);

    }
    deleteReport(id){
        return axios.delete(REPORT_API_BASE_URL+ '/' + id);

    }

    getReportById(id){
        return axios.get(REPORT_API_BASE_URL+ '/' + id);
    }

}
export default new ReportService()
